window.bookSummaryJSON = "<p><b>Find the missing target in an illegal game world. Kill the monsters. Return home for the paycheck.</b></p> <p>Decorated Marine commander, Damon Williams, never thought his latest mission would take place in a virtual world fighting monsters...but when a high-value VIP disappears after being stealthily transported to a banned VRMMORPG, Damon's the only hope.</p> <p>He must lead a group of rescuers into the Epiphany Realms, an unforgiving world infested with terrifying monsters and worse.</p> <p><i>Pain is real. Death is permanent.</i></p> <p>He and his crew must adapt quickly, trust each other, and fight to survive. And if all that's not bad enough, they'll also have to race against time to avoid the realm's disintegration and mutation effects.</p> <p><b><i>Resurrection</i></b><b> is the first book in the Epiphany Realms series of LitRPG / GameLit novels. It features a full-immersion universe, race and class designations, unique creatures, dungeon crawling, and level progression. It's perfect for fans of Dave Willmarth, Michael Chatfield, and Dakota Krout.</b></p> <p>Contains mature themes.&nbsp;&nbsp;</p>"; 
